import axios from 'axios';

export const register = newUser => {
    return axios
      .post(`api-register`, {
        name: newUser.name,
        email: newUser.email,
        password: newUser.password,
        address: newUser.address,
        phone: newUser.phone
      })
      .then(response => {
        return response.data;
      })
      .catch(err => {
        console.log(err);
      })
  }

  export const login = user => {
    return axios
      .post(`api-login`, {
        username: user.username,
        password: user.password
      })
      .then(response => {
        return response.data;
      })
      .catch(err => {
        console.log(err);
      })
  }
